import React from 'react';
import {Swiper, SwiperSlide} from 'swiper/react';
import SwiperCore, {Navigation} from 'swiper';
import 'swiper/swiper-bundle.css';
import './Slider.css';

SwiperCore.use([Navigation]);

function Slider() {
    return (
      <div className="slider-container">
      <Swiper navigation slidesPerView={2} spaceBetween={10}>
        <SwiperSlide>
        <img className="slide-img" src="/images/black.jpg" alt="bla"/>
        <div className="slides">Slide1</div>
        </SwiperSlide>
        <SwiperSlide><div className="slides">Slide2</div></SwiperSlide>
        <SwiperSlide><div className="slides">Slide3</div></SwiperSlide>
        <SwiperSlide><div className="slides">Slide4</div></SwiperSlide>
        <SwiperSlide><div className="slides">Slide5</div></SwiperSlide>
        <SwiperSlide><div className="slides">Slide6</div></SwiperSlide>
        <SwiperSlide><div className="slides">Slide7</div></SwiperSlide>
      </Swiper>
      </div>
    )
}

export default Slider;
